import React from "react";
import { Link } from "react-router-dom";
import "./style.css";
function Sidebaritem(props) {
  return (
    <li style={{ listStyle: "none" }} key={props.keyz}>
      <Link to={props.value.url} className="row" id={props.keyz}>
        <div id="icon">{props.value.icon}</div>{" "}
        <div id="name">{props.value.name}</div>
      </Link>
    </li>
  );
}

export default Sidebaritem;
